import React from "react";
import "./Signup.css";
import { Link } from "react-router-dom";

const Signup = () => {
  return (
    <div className="Signup">
      <h1> Sign Up</h1>
      <Link className="Link" to="/Login">
        <h2> Login</h2>
      </Link>
    </div>
  );
};

export default Signup;
